import WeatherLocation from './WeatherLocation';


const LocationList=()=>(
    <div className="">
        <WeatherLocation city={'Buenos Aires,ar'}/>
        <WeatherLocation city={'Santiago,ch'}/>
        <WeatherLocation city={'Bogotá,col'}/>

    </div>
);
export default LocationList;
